  true,\n\t\"url\": null,\n\t\"notes\": \"<p>SSP ACO PUF - To address the increasing
  number of requests for SSP ACO data, the Centers for Medicare (CM) has created a
  standard analytical file that CMS can use to efficiently satisfy these requests.
  \ It is the intent of CM to publish the ACO-level public-use file (PUF) that contains
  ACO-specific metrics as well as summarized beneficiary and provider information
  for each performance year of the SSP program.</p>n\",\n\t\"license_title\": \"Other
